const App = function(props) {
  const [count, setCount] = useState(0);
  const [items, setItems] = useState([]);

  function handleChange() {
    setCount(count + 1);
  }
  
  function getAllImages() {
    axios.get(`${ENDPOINT}/get-images`)
      .then(res => {
        console.log(res.data);
        setItems(res.data);
      })
  }

  function handleClick() {
    console.log('Hey, you clicked!');
    getAllImages();
  }


  return (  
    <div>
      <MyNav count={count} user={props.user} />
      <Image />
      <button onClick={handleClick}>Reload</button>
      <div className="card-style d-flex justify-content-center">
        {items.map(function(item, index) {
          console.log(item.imageUrl)
         return (
          <>
          {
            item.imageUrl.map(function(image, imageIndex){
            console.log(image);
          return (
            <Item
              key={(imageIndex + (index+1)*10)}
              src={image}
              addToCart={handleChange}
              changeRoot={props.changeRoot}
            />
          );
          })
         
          }
          </>
        )
        })}
      </div>
    </div>
  );
};

export default App;
